import React from 'react';

const Product = (props) => {
    return (
        <div className="product">
            <div className="product__content">
                <strong>{props.id}</strong>
                {props.sku}
                {props.name}
                {props.price}
                {props.productType}
            </div>
        </div>
    );
};

export default Product;
